import logo from './logo.svg';
import './App.css';
import Button from './components/CustomButtonComponent';

function App() {
  return (
    <>
      <h1>Colorful Custom Button Components</h1>
      <Button 
        border="none"
        color="blue"
        height = "200px"
        onClick={() => alert()}
        radius = "50%"
        width = "200px"
        children = "I'm a pink circle!"
      />
    </>
  );

}

export default App;
